import { useHistory } from "react-router-dom";
import { useLocation } from "react-router-dom";
import axios from "axios"

function Home(){

    const location = useLocation();
    const email = location.state.params;
    let history = useHistory();
    function func1(){
        axios.post("/reqData",{
            email: email
        }).then((res) => {
            //console.log(res.data[0].name)
        
        var password = res.data[0].password
        var contact = res.data[0].contact
        var name = res.data[0].name
        history.push('/profile',{body:name,email,contact,password})
    });
        

    }
    function func2(){

     
        
        history.push('/login')
        

    }

    return(
        <div>
            <center>
            <h1>Home</h1>
            <button onClick={()=>func1()}>Profile</button>
            <button onClick={()=>func2()}>LogOut</button>
            
            </center>
            
        </div>
    )
}


export default Home
